import React, { useEffect } from "react";
import "./Home.css";
import { useNavigate } from "react-router-dom";

export default function Home() {
  const navigate = useNavigate();
  useEffect(() => {
    const token = localStorage.getItem("jwt");
    if (!token) {
      navigate("./signup");
    }
  }, []);
  return (
    <div className="home">
      <div className="card">
        <div className="card-header">
          <div className="card-pic">
            <img
              src="https://images.unsplash.com/photo-1597589827317-4c6d6e0a90bd?ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxzZWFyY2h8M3x8c3F1YXJlfGVufDB8fDB8fHww&auto=format&fit=crop&w=1000&q=60"
              alt=""
            />
          </div>
          Ronit
        </div>
        <div className="card-image">
          <img
            src="https://images.unsplash.com/photo-1689413674132-bba03bd76e45?ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8fA%3D%3D&auto=format&fit=crop&w=386&q=80"
            alt=""
          />
        </div>
        <div className="card-content">
          <span class="material-symbols-outlined">favorite</span>
          <p>1 Like</p>
          <p>This is amazing</p>
        </div>
        <div className="add-comment">
          <span class="material-symbols-outlined">mood</span>
          <input type="text" placeholder="Add a comment" />
          <button className="comment">Post</button>
        </div>
      </div>
    </div>
  );
}
